function Logout() {
    const handleLogout = () => {
        localStorage.removeItem('token')
        window.location.href = '/'
    }

    return (
        <div className="logout-container">
            <h1>Logout</h1>
            <p>is the Hardest button to click, </p>
            <p>but still here it is.</p>
            <button>Logout</button>
        </div>
    )
}

export default Logout
